import React from "react";

export default function placeholder() {
  return (
    <div>
      <div className="container mx-auto">
        <div className="grid grid-rows grid-cols-2">
          <div className="row">
            <div className="col">
              <div className="text-blue font-bold text-4xl font-serif">
                Forget Busy Work, Start Next Vacation
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}
